import React from 'react';

function dashboardFooter(){
    return(
        <div>
            <div>
            <footer className="dashboard-footer">
                <div className="copyright">
                &copy; Copyright <strong><span>Naevis</span></strong>. All Rights Reserved
                </div>
            </footer>
            </div>
        </div>
            )
}

export default dashboardFooter;
